import NavBar from "./components/NavBar.js";
import ProductList from "./components/ProductList.js";
import ShoppingCart from "./components/ShppingCart.js";

export default function App() {
  render(); 
    return (
      <div className="App">
        <Router>
          <div>
            <Nav />
            <Switch>
              <Route exactly component={ProductList} pattern="/" />
              <Route exactly component={ShoppingCart} pattern="/shoppingCart" />
            </Switch>
          </div>
        </Router>
      </div>
    );
  
}
